import './App.css';
import Navbar from './Components/Navbar/Navbar';

function App() {
  return (
    <div className="App">
      <BrowserRouter>

     <Routes>
       <Route path="/">
       <Route index element={<Home />} />
       <Route index element={<Form />} />
       <Route path="/form" element={<Form />} />
      <Route  path="/sign in" element={<FormSignin />} />
       </Route>
     </Routes>
   </BrowserRouter>

    </div>
  );
}

export default App;
